import React from 'react';
import styles from './Product.module.scss';

const Product = ({
    brand,
    description,
    series,
    src
}) => (
    <div className={styles.container}>
        <p>{brand} {series} {description}</p>
        <img src={src} alt={brand} />
        <button>View Package</button>
    </div>
);

export default Product;
